INSERT INTO `v1_8d33d16c688eaf11970553a7d163cc824402ab21e050d17f48a29502a69f17bd` VALUES (1, 6000, 0, 1, "---", 2, 3, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", "アサヒ", "");
INSERT INTO `v1_8d33d16c688eaf11970553a7d163cc824402ab21e050d17f48a29502a69f17bd` VALUES (1, 16000, 3, 3, "アドレナリン", 3, 0, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", "部員3", "ホームランを連発すると、連発数に応じてパワーアップする");
INSERT INTO `v1_8d33d16c688eaf11970553a7d163cc824402ab21e050d17f48a29502a69f17bd` VALUES (1, 30000, 2, 2, "ラッキー", 4, 2, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", "{0}", "幸運のハプニングを呼び込む");
INSERT INTO `v1_8d33d16c688eaf11970553a7d163cc824402ab21e050d17f48a29502a69f17bd` VALUES (0, 50000, 1, 0, "", 5, 1, "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", "選手名鑑 おまけページ", "");
